package com.example.uriel.ordertracker.App.Services.Impl;

import com.example.uriel.ordertracker.App.Model.Brand;
import com.example.uriel.ordertracker.App.Model.Product;
import com.example.uriel.ordertracker.App.Services.Interface.IProductService;

import java.util.ArrayList;

/**
 * Created by Uriel on 27-Mar-16.
 */
public class ProductService implements IProductService {
    public ArrayList<Product> getAll(){
        ArrayList<Product> products = new ArrayList<>();

        Product product1 = new Product(1, "Producto 1", 50, new Brand(1, "Marca 1"), "");
        Product product2 = new Product(2, "Producto 2", 100, new Brand(2, "Marca 2"), "");

        products.add(product1);
        products.add(product2);

        return products;
    }

    public ArrayList<Product> getByBrand(String brand){
        ArrayList<Product> products = new ArrayList<>();
        Product product = null;
        if(brand.equals("Marca 1")){
            product = new Product(1, "Producto 1", 50, new Brand(1, "Marca 1"), "");
        }else{
            product = new Product(2, "Producto 2", 100, new Brand(2, "Marca 2"), "");
        }

        products.add(product);

        return products;
    }
}
